import ValidateRolAdmin from "../../componentes/Componentes_admin/ValidateRolAdmin";

const GenerarReportesAdmin = () => (

      <>
        <ValidateRolAdmin/>
        <NavegacionAdmin />
        <ContenidoGenerarReportesAdmin />
      </>
    )
export default GenerarReportesAdmin;
